    {
        public ConfiguracionConfiguration(EntityTypeBuilder<Configuracion> entityBuilder)
        {
            entityBuilder.HasKey(x => x.Id);

            entityBuilder.Property(x => x.Variable).IsRequired().HasMaxLength(250);
            entityBuilder.Property(x => x.Nombre).IsRequired().HasMaxLength(250);
            entityBuilder.Property(x => x.Valor).IsRequired().HasMaxLength(250);
            entityBuilder.Property(x => x.Estado).IsRequired().HasMaxLength(250);

            List<Configuracion> configuraciones = new List<Configuracion>();
            configuraciones.Add(new Configuracion { Id = 1, Nombre = "RutaFisicaArchivos", Estado = "Activa", Valor = "c:\\Archivos\\", Variable = "RutaFisicaArchivos" });
